import React, { useState } from 'react';
import './List.css';

const List = (props) => {
  const { listItems } = props;
  const renderedList = listItems.map((item) => (
    <button className="todoItem">{item.title}</button>
  ));

  return <div>{renderedList}</div>;
};

export default List;
